class Content extends Component {


        async componentDidMount(){
        const url='https://api.nytimes.com/svc/books/v3/lists/names.json?api-key=HUdzmG9oky8WRmLzxelOmioGiDHIm0VJ';
        const response=await fetch(url);
        const data= await response.json();
        console.log(data.results)
        }



    render() { 

        return ( 
            <div><h1>Hiiii</h1>
        <Root object={this.data.results} />
    </div>
         );
    }
}

export default Content;
